import React from 'react';
import './App.css';
import {} from './controle/ControleEditora';
import {} from './controle/ControleLivros';
import LivroLista, {} from "./LivroLista";
import LivroDados from './LivroDados';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function App() {

  return ( 
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/livros">Lista de Livros</Link>
            </li>
            <li>
              <Link to="/dados">Dados do Livro</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/livros">
            <LivroLista />
          </Route>
          <Route path="/dados">
            <LivroDados />
          </Route>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
